import React, { useState } from "react";

import "./SearchPost.css";

const removeSearchForm = () => {
  const div = document.getElementsByClassName("searchPostContainer");
  div.remove();
};

const SearchPost = () => {
  return (
    <div className="searchPostContainer">
      <button className="searchOffBtn" onClick={removeSearchForm}>
        닫기
      </button>
      <input type="text" />
      <div>입력 후 엔터를 눌러주세요</div>
    </div>
  );
};

export default SearchPost;
